import React from "react";
import ReactDOM from "react-dom";
const el = (
<div>
  <h1>My to do List</h1>
  <input placeholder = "search" />
  <ul> 
    <li> Learn React</li>
    <li> Build awesome project</li>
  </ul>
</div>
  );
ReactDOM.render(el, document.getElementById('root'));
